util.createJsonArea = function () {
        var $div = $('<div class="form-jsonarea" data-type="jsonarea"></div>');
        var options = {
            "mode": "code",
            "modes": [
                "tree",
                "form",
                "code",
                "text",
                "view"
            ],
            "search": false,
            "history": false
        };
        var editor = new JSONEditor($div[0], options);
        $div.val = $div[0].val = function (data) {
            if (arguments.length > 0) {
                try {
                    editor.set(JSON.parse(data));
                } catch (e) {
                    editor.set(data);
                }

            } else {
                return editor.get();
            }
        }
        return $div;
    }
