it.util.translateDate = function(datas){
    if(!datas) return datas;
    if (datas instanceof Array) {
        if (datas.length < 1) {
            return datas;
        }
        var result = [];
        for(var i = 0 ; i < datas.length ; i++){
            var data = it.util.translateDateForOneData(datas[i]);
            result.push(data);
        }
        return result;
    }
    return it.util.translateDateForOneData(datas);
}

